import "./home.css";

export default function Home() {
  return (
    <div className="Fullheight" id="home">
      <div>Hey There, Welcome!!</div>

      <div className="wave-text">
        I am <span>S</span> <span>R</span> <span>U</span>
        <span>T</span> <span>H</span> <span>I</span>
      </div>

      <a href="https://drive.google.com/file/d/1QG-MTWF-vSX62hYl5pAPM7GSjTeXMqUe/view?usp=sharing">
        Resume
      </a>

      <img
        src="https://media.gettyimages.com/id/1400646644/photo/girl-sitting-on-the-high-school-stairs-studing-with-laptop.jpg?s=612x612&w=0&k=20&c=tYZfcoFQ8FmXBwXZA2SdUyCgoVLj8xOFS5RgytMieOI="
        alt="student"
      />
      <div className="max-w-sm bg-white border border-gray-200 rounded-lg shadow-sm dark:bg-gray-800 dark:border-gray-700 mt-4"></div>
    </div>
  );
}
